// SPDX-License-Identifier: MIT

/// @title: Mfers 3D
/// @dev: @zeroknowledgep
/// @artist: @_SWARTX_ 
/// @OriginalArtBy: @sartoshi_nft

///////////////////////////////////////////////////////////////////
//////
//////
//////
//////
//////
//////
///////////////////////////////////////////////////////////////////

pragma solidity ^0.8.11;

import "erc721a/contracts/ERC721A.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/PullPayment.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract Mfers3D is ERC721A, Ownable, PullPayment{
  using SafeMath for uint;
  using Strings for uint256;

  mapping (uint256 => bool) specialToken;

  address constant devAddr = address(0xDE275BA0f69d1A83966958A56Bc82edAA3A24F8C);
  address constant mferCommunityAddr = address(0x3728ab20F0da7E5863F25865Ad7f5D6863e5000E);
  address mferContractAddr;
  bool public presale = true;
  bool public paused = false;
  bool public revealed = false;
  bool public revealed2 = false;

  uint256 public cost = 2500000000 wei;
  uint256 public mferCommunityShare = cost.div(5);
  uint256 private devShare = cost.div(10);
  uint256 private ownerShare = cost.sub(devShare.add(mferCommunityShare));
  uint256 public maxSupply = 10;
  uint256 public maxMintPerAddress = 1;
  uint256 public maxmintPresale = 2;
  
  string baseURI;
  string baseURI2;
  string baseExtension = ".json";
  string notRevealedUri;

  constructor(
    string memory _name,
    string memory _symbol,
    string memory _initBaseURI,
    string memory _initNotRevealedUri,
    address _mferAddress
  ) ERC721A(_name, _symbol) {
    setBaseURI(_initBaseURI);
    setNotRevealedURI(_initNotRevealedUri);
    setMferAddress(_mferAddress);

  // nearly 30 special IDs will be specified during contract deployment
    setSpecialTokenState(4,true);
    setSpecialTokenState(7,true);
    setSpecialTokenState(12,true);
  }

  function mint(uint256 quantity) external payable {
    require(!paused, "the contract is paused");
    uint256 _minted = _totalMinted();
    require(_minted.add(quantity)<=maxSupply,"Cant mint above max supply");
    require(quantity > 0, "mint atleast 1 NFT");
    uint256 _mintedbysender = _numberMinted(msg.sender);
    require( _mintedbysender.add(quantity) <= maxMintPerAddress, "Maximum mint limit per wallet");
    
    if(presale){
        require(_minted.add(quantity)<=maxmintPresale, "Presale limit over");
        require(ismferOwner(msg.sender),"not whitelisted for presale");
    }else{
        require(msg.value >= cost.mul(quantity), "insufficient funds");

        _asyncTransfer(devAddr, devShare.mul(quantity));
        _asyncTransfer(mferCommunityAddr, mferCommunityShare.mul(quantity));
        _asyncTransfer(owner(), ownerShare.mul(quantity));
    }

 
    _safeMint(msg.sender, quantity);
  }

  function _baseURI() internal view virtual override returns (string memory){
    return baseURI;
  }

  function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
    if (!_exists(tokenId)) revert URIQueryForNonexistentToken();
  
    if(!revealed){
      return notRevealedUri;
    }

    if(specialToken[tokenId]){
      if(!revealed2){
        return notRevealedUri;
      }  
      return bytes(baseURI2).length != 0 ? string(abi.encodePacked(baseURI2, tokenId.toString(), baseExtension)) : '';
    }

    return bytes(baseURI).length != 0 ? string(abi.encodePacked(baseURI, tokenId.toString(), baseExtension)) : '';
  }

  // Internal functions only set during contract deployment through constructor
  function setSpecialTokenState(uint256 _tokenId, bool _state) internal{
    specialToken[_tokenId] = _state;
  }
  
  function setMferAddress(address _mferAddress) internal{
    mferContractAddr = _mferAddress;
  }

  function setNotRevealedURI(string memory _notRevealedUri) internal{
    notRevealedUri = _notRevealedUri;
  }

  function ismferOwner(address _minter) internal view returns (bool) {
    // logic to verify the address _minter hold original mfer
    IERC721 token = IERC721(mferContractAddr);
    if(token.balanceOf(_minter)>=1){
      return true;
    }else{
      return false;
    }    
  }

// Public functions to modify state by owner

  function setBaseURI(string memory _BaseURI) public onlyOwner{
    baseURI = _BaseURI;
  }


  function setMintPublic() public onlyOwner{
    presale = false;
  }

  function setRevealed(bool _state,bool _state2) public onlyOwner{
    revealed = _state;
    revealed2 = _state2;
  }

  function pause(bool _state) public onlyOwner{
    paused = _state;
  }

  function setBaseURI2(string memory _BaseURI2) public onlyOwner{
